      // Owl Carousel
      OwlCarousel: function () {

          $('.owl-carousel').each(function () {
              var a = $(this),
                  items = a.data('items') || [1, 1, 1],
                  margin = a.data('margin'),
                  loop = a.data('loop'),
                  nav = a.data('nav'),
                  dots = a.data('dots'),
                  center = a.data('center'),
                  autoplay = a.data('autoplay'),
                  autoplaySpeed = a.data('autoplay-speed'),
                  rtl = a.data('rtl'),
                  autoheight = a.data('autoheight');

              var options = {
                  nav: nav || false,
                  loop: loop || true,
                  dots: dots || false,
                  center: center || false,
                  autoplay: autoplay || false,
                  autoHeight: autoheight || false,
                  rtl: rtl || false,
                  margin: margin || 0,
                  autoplayTimeout: autoplaySpeed || 5000,
                  autoplaySpeed: 400,
                  autoplayHoverPause: true,
                  responsive: {
                      0: {
                          items: items[2] || 1
                      },
                      576: {
                          items: items[1] || 1
                      },
                      1200: {
                          items: items[0] || 1
                      }
                  },
                  onInitialized: function (event) {
                      var $carousel = $('.owl-carousel'),
                          $carouselDots = $carousel.find('.owl-dot');

                      $carouselDots.each(function () {
                          var $self = $(this);

                          $self.attr('aria-label', 'Carousel page ' + ($self.index() + 1));
                      });

                      $carousel.find('.owl-prev').attr('aria-label', 'Carousel previous').attr('role', 'button');
                      $carousel.find('.owl-next').attr('aria-label', 'Carousel next').attr('role', 'button');
                  }
              };

              a.owlCarousel(options);
          });
      },

      // Swiper
      Swiper: function () {

        $('.swiper-container').each(function (index, element) {
            var $this = $(this)

            $this.find(".swiper-pagination").addClass("swiper-pagination-" + index);
            $this.find(".swiper-button-next").addClass("swiper-button-next-" + index);
            $this.find(".swiper-button-prev").addClass("swiper-button-prev-" + index);

            var options = {
                parallax: true,
                speed: 1500,
                simulateTouch: false,
                effect: 'fade',

                //pagination
                pagination: {
                    el: '.swiper-pagination-' + index,
                    clickable: true
                },

                // navigation
                navigation: {
                    nextEl: '.swiper-button-next-' + index,
                    prevEl: '.swiper-button-prev-' + index,
                }

            };

            var slider = $(this);

            if ($(this).hasClass('swiper-container-carousel')) {
                options.spaceBetween = 10;
                options.effect = 'slide';
                options.simulateTouch = true;
                options.slideToClickedSlide = true;
            }

            new Swiper(slider, options);
        });



    },

